(1, '2025-03-15 13:06:15', '2022-05-06 11:23:55', 'method', 'RecurringInvoicesJob', NULL, 'compta/facture/class/facture-rec.class.php', 'FactureRec', 'createRecurringInvoices', NULL, NULL, 'facture', 50, NULL, NULL, '2022-05-06 23:00:00', NULL, NULL, NULL, NULL, '86400', 1, 0, NULL, 0, 1, 0, '$conf->facture->enabled', NULL, NULL, NULL, 'Generate recurring invoices', NULL, 1, NULL, NULL),
(2, '2022-05-06 14:23:55', '2022-05-06 11:23:55', 'method', 'SendEmailsRemindersOnInvoiceDueDate', NULL, 'compta/facture/class/facture.class.php', 'Facture', 'sendEmailsRemindersOnInvoiceDueDate', '10,all,EmailTemplateCode', NULL, 'facture', 50, NULL, NULL, '2022-05-06 23:00:00', NULL, NULL, NULL, NULL, '86400', 1, 0, NULL, 0, 0, 0, '$conf->facture->enabled', NULL, NULL, NULL, 'Send an emails when the unpaid invoices reach a due date + n days = today. First param is the offset n of days, second parameter is \"all\" or a payment mode code, last parameter is the code of email template to use (an email template with EmailTemplateCode must exists. the version in the language of the thirdparty will be used in priority).', NULL, 1, NULL, NULL),
(3, '2025-03-15 13:08:27', '2025-03-15 10:08:27', 'method', 'RecurringSupplierInvoicesJob', '', 'fourn/class/fournisseur.facture-rec.class.php', 'FactureFournisseurRec', 'createRecurringInvoices', '', '', 'fournisseur', 51, NULL, '2025-03-15 10:08:27', '2025-03-15 23:00:00', NULL, NULL, NULL, NULL, '86400', 1, 0, 0, 0, 1, 0, 'isModEnabled(\"supplier_invoice\")', NULL, NULL, NULL, 'Generate recurring supplier invoices', '', 1, NULL, NULL),
(4, '2025-03-15 13:08:27', '2025-03-15 10:08:27', 'method', 'SendEmailsRemindersOnSupplierInvoiceDueDate', '', 'fourn/class/fournisseur.facture.class.php', 'FactureFournisseur', 'sendEmailsRemindersOnSupplierInvoiceDueDate', '10,all,EmailTemplateCode,duedate', '', 'fournisseur', 50, NULL, '2025-03-15 10:08:27', '2025-03-15 23:00:00', NULL, NULL, NULL, NULL, '86400', 1, 0, 0, 0, 0, 0, 'isModEnabled(\"supplier_invoice\")', NULL, NULL, NULL, 'Send an email when we reach the supplier invoice due date (or supplier invoice date) - n days. First param is n, the number of days before due date (or supplier invoice date) to send the remind (or after if value is negative), second parameter is \"all\" or a payment mode code, third parameter is the code of the email template to use (an email template with the EmailTemplateCode must exists. The version of the email template in the language of the thirdparty will be used in priority. Language of the thirdparty will be also used to update the PDF of the sent supplier invoice). The fourth parameter is the string \"duedate\" (default) or \"invoicedate\" to define which date of the supplier invoice to use.', '', 1, NULL, NULL);
